import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Dashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login-ui');
  };

  const services = [
    'Job Search Assistance',
    'Resume & Cover Letter Help',
    'SIN Registration Guidance',
    'Housing & Rental Tips',
    'Public Transit Setup',
    'Bank Account & Credit Card Help',
  ];

  const checklist = [
    'Apply for SIN (Social Insurance Number)',
    'Open a Canadian bank account',
    'Get a local SIM card',
    'Apply for a health card (MSP/OHIP)',
    'Learn about public transit (Compass/Presto)',
    'Build your credit history',
    'Start looking for housing',
    'Register for newcomer orientation programs',
  ];

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold text-gray-800">Welcome to Your Dashboard</h1>
        <button
          onClick={handleLogout}
          className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700"
        >
          Logout
        </button>
      </div>

      {/* Services Section */}
      <div className="bg-white shadow-md rounded p-6 mb-6">
        <h2 className="text-xl font-semibold mb-4">Available Services</h2>
        <ul className="list-disc list-inside text-gray-700 space-y-2">
          {services.map((service, index) => (
            <li key={index}>{service}</li>
          ))}
        </ul>
      </div>

      {/* Checklist Section */}
      <div className="bg-white shadow-md rounded p-6">
        <h2 className="text-xl font-semibold mb-4">Things to Do When You Arrive in Canada</h2>
        <ul className="list-decimal list-inside text-gray-700 space-y-2">
          {checklist.map((item, index) => (
            <li key={index}>{item}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}
